import "./Main.css";

import {BrowserRouter, Routes, Route} from "react-router-dom";

function Main(){

  return(
    <BrowserRouter>
      <main>
        <Routes>
          <Route path="/" element="<Home />"></Route>
        </Routes>
      </main>
    </BrowserRouter>
  )
}
export default Main;
